import React from "react";
import {
  CardContainer,
  CardTop,
  CardDot,
  CardBar,
  CardBg,
  CardBtn,
} from "./CardElms";

const Card = () => {
  return (
    <CardContainer>
      <CardTop>
        <CardDot />
        <CardDot />
        <CardDot />
        <CardBar />
      </CardTop>
      <CardBg>
        <CardBtn>Live Demo</CardBtn>
        <CardBtn>Repository</CardBtn>
      </CardBg>
    </CardContainer>
  );
};

export default Card;
